def rearrange_bigger(n): 
    arr = list(map(int, str(n))) 
    i = len(arr) - 1
    while i > 0 and arr[i - 1] >= arr[i]: 
        i -= 1
    if i == 0: 
        return -1
    j = len(arr) - 1
    while arr[j] <= arr[i - 1]: 
        j -= 1
    arr[i - 1], arr[j] = arr[j], arr[i - 1] 
    arr[i:] = reversed(arr[i:]) 
    return int(''.join(map(str, arr)))

