def max_profit(price, k): 
    n = len(price) 
    if k >= n: 
        return sum(price) 
    profit = [[0 for x in range(n)] for x in range(k + 1)] 
    for i in range(1, k + 1): 
        for j in range(n): 
            profit[i][j] = profit[i][j - 1] 
            if j > 0: 
                profit[i][j] = max(profit[i][j], 
                                   profit[i - 1][j - 1] + 
                                   price[j]) 
    return profit[k][n - 1]

